// input index is polar index, returns aoa @ corisponding polar index
export function indexaoa(inputindex: number, aoaindexes: number[], aoas: number[]): number {
  if (inputindex >= 1) return aoas[aoas.length - 1]
  if (inputindex < 0) return aoas[0]
  const topi = aoaindexes.findIndex((i) => inputindex < i)
  const bottomi = topi - 1
  const alpha = (inputindex - aoaindexes[bottomi]) / (aoaindexes[topi] - aoaindexes[bottomi])
  return aoas[bottomi] * (1 - alpha) + aoas[topi] * alpha
}

// returns polar index
export function aoatoindex(inputaoa: number, aoaindexes: number[], aoas: number[]) {
  if (inputaoa <= aoas[aoas.length - 1]) return 1
  if (inputaoa >= aoas[0]) return 0
  const bottomaoai = aoas.findIndex((a) => inputaoa > a)
  const topaoai = bottomaoai - 1
  const alpha = (inputaoa - aoas[bottomaoai]) / (aoas[topaoai] - aoas[bottomaoai])
  return aoaindexes[bottomaoai] * (1 - alpha) + aoaindexes[topaoai] * alpha
}

// returns aoa index
export function aoatoaoaindex(inputaoa: number, aoas: number[]) {
  if (inputaoa <= aoas[aoas.length - 1]) return { bottomi: aoas.length - 1, topi: aoas.length - 1, alpha: 1 }
  if (inputaoa >= aoas[0]) return { bottomi: 0, topi: 0, alpha: 0 }
  const bottomaoai = aoas.findIndex((a) => inputaoa > a)
  const topaoai = bottomaoai - 1
  const alpha = (inputaoa - aoas[bottomaoai]) / (aoas[topaoai] - aoas[bottomaoai])
  return { bottomi: bottomaoai, topi: topaoai, alpha: alpha }
}

export function aoatospeed(aoa: number, polar: WSEQPolar, rho: number) {
  if (polar.aoas && polar.stallpoint) {
    const i = aoatoaoaindex(aoa, polar.aoas)
    const c = interpolatecoefficients(i, polar.stallpoint)
    return coefftoss(c.cl, c.cd, polar.s, polar.m, rho)
  }
  return { vxs: 1, vys: 1 }//wrong polar
}

export function interpolatecoefficients(i: { bottomi: number, topi: number, alpha: number }, stallpoint: Coefficients[]): Coefficients {
  const cl = stallpoint[i.bottomi].cl * (1 - i.alpha) + stallpoint[i.topi].cl * i.alpha
  const cd = stallpoint[i.bottomi].cd * (1 - i.alpha) + stallpoint[i.topi].cd * i.alpha
  return { cl, cd }
}

export function interpolatecp(i: { bottomi: number, topi: number, alpha: number }, cp: number[]): number {
  const cpv = cp[i.bottomi] * (1 - i.alpha) + cp[i.topi] * i.alpha
  return cpv
}

// input index is polar index, returns center of pressure @ corisponding polar index
export function indexcp(inputindex: number, aoaindexes: number[], cp: number[]): number {
  if (inputindex >= 1) return cp[cp.length - 1]
  if (inputindex <= 0) return cp[0]
  const topi = aoaindexes.findIndex((i) => inputindex < i)
  const bottomi = topi - 1
  const alpha = (inputindex - aoaindexes[bottomi]) / (aoaindexes[topi] - aoaindexes[bottomi])
  return cp[bottomi] * (1 - alpha) + cp[topi] * alpha
}

export function aoatosustained(inputaoa: number, polar: WSEQPolar, rho: number): { ss: SustainedSpeeds, index: number } {
  if (polar.aoaindexes && polar.aoas) {
    const aoas = polar.aoas
    const aoaindexes = polar.aoaindexes
    if (inputaoa <= aoas[aoas.length - 1]) return { ss: getspeed(1, polar, rho), index: 1 }
    if (inputaoa >= aoas[0]) return { ss: getspeed(0, polar, rho), index: 0 }
    const bottomaoai = aoas.findIndex((a) => inputaoa > a)
    const topaoai = bottomaoai - 1
    const alpha = (inputaoa - aoas[bottomaoai]) / (aoas[topaoai] - aoas[bottomaoai])
    const polarindex = aoaindexes[bottomaoai] * (1 - alpha) + aoaindexes[topaoai] * alpha
    return { ss: getspeed(polarindex, polar, rho), index: polarindex }
  } else {// handle missing inputs
    return { ss: getspeed(0.5, polar, rho), index: 0.5 }
  }
}

